import "./Button_style.scss";
import { IconContext } from "react-icons";
import { GrPowerReset } from "react-icons/gr";
import React from "react";

const Button = () => {
  return (
    <div>
      <div className="btn">
        <IconContext.Provider>
          <GrPowerReset size={25} />
        </IconContext.Provider>
      </div>
    </div>
  );
};

export default Button;
